    public class FixIntegrationsTabCommandHandler : IRequestHandler<FixIntegrationsTabCommand>
    {
        private readonly IActionstepService _actionstepService;
        private readonly IMediator _mediator;

        public FixIntegrationsTabCommandHandler(IActionstepService actionstepService, IMediator mediator)
        {
            _actionstepService = actionstepService;
            _mediator = mediator;
        }

        public async Task<Unit> Handle(FixIntegrationsTabCommand command, CancellationToken cancellationToken)
        {
            if (command is null) throw new System.ArgumentNullException(nameof(command));

            var tokenSetQuery = new TokenSetQuery(command.AuthenticatedUser?.Id, command.OrgKey);

            var wcaIntegrationsTabDataCollectionFields = await _actionstepService.Handle<ListDataCollectionFieldResponse>(new ListDataCollectionFieldsRequest
            {
                DataCollectionNames = { "WCA_Integration" },
                TokenSetQuery = tokenSetQuery,
                ActionTypes = { command.ActionTypeId }
            });

            var updateDataCollectionFieldsRequest = new UpdateDataCollectionFieldsRequest
            {
                TokenSetQuery = tokenSetQuery
            };

            foreach (var field in wcaIntegrationsTabDataCollectionFields.DataCollectionFields)
            {
                updateDataCollectionFieldsRequest.DataCollectionFields.Add(field);

                var supportedField = _supportedFields.SingleOrDefault(f => f.Name == field.Name);

                if (supportedField != null)
                {
                    field.Description = supportedField.Description;
                    field.CustomHtmlAbove = supportedField.CustomHtmlAbove;
                    field.CustomHtmlBelow = supportedField.CustomHtmlBelow;
                }
                else
                {
                    field.Description = null;
                    field.CustomHtmlBelow = null;
                    field.CustomHtmlAbove = null;
                }
            }

            await _actionstepService.Handle(updateDataCollectionFieldsRequest);

            var createDataCollectionFieldRequest = new CreateDataCollectionFieldRequest();
            var dataCollectionId = wcaIntegrationsTabDataCollectionFields.Linked.DataCollections.Single().Id;
            var fieldsToCreate = _supportedFields.Where(sf => !wcaIntegrationsTabDataCollectionFields.DataCollectionFields.Exists(f => f.Name == sf.Name));

            foreach (var field in fieldsToCreate)
            {
                var dataCollectionField = new DataCollectionField
                {
                    Id = dataCollectionId + "--" + field.Name,
                    Name = field.Name,
                    DataType = "HtmlReadOnly",
                    Label = field.Name,
                    CustomHtmlAbove = field.CustomHtmlAbove,
                    CustomHtmlBelow = field.CustomHtmlBelow,
                    Description = field.Description,
                    Links = new DataCollectionFieldLink
                    {
                        DataCollection = dataCollectionId.ToString(CultureInfo.InvariantCulture)
                    }
                };

                createDataCollectionFieldRequest.DataCollectionFields.Add(dataCollectionField);
            }

            createDataCollectionFieldRequest.TokenSetQuery = tokenSetQuery;
            await _actionstepService.Handle(createDataCollectionFieldRequest);

            return Unit.Value;
        }

